import "./Card.css";
// import Link from "./Link";

const Card = (props) => {
  return (
    <div>
      <image src={props.img}></image>
      <h3>{props.title}</h3>
      <p>{props.des}</p>
      <div>
        <link src={props.links[0]} />
        <link src={props.links[1]} />
      </div>
    </div>
  );
};
export default Card;
